import { useState, useEffect } from 'react';
import '../styles/upload.css';



const Upload = () => {

  return (
      <Routes>
          <Route index element={<UploadPreview/>} />
          <Route path=':upload_category' element={<UploadCategory/>} />
      </Routes>
  );
};

export default Upload;
